import React, { Fragment } from "react";
import styled  from "styled-components";

const columns = useMemo(
    () => [

      {
        Header: 'First Name',
        accessor: 'first_name',
      },
      {
        Header: 'Last Name',
        accessor: 'last_name',
      },
      {
        Header: 'Address',
        accessor: 'address',
      },
      {
        Header: 'City',
        accessor: 'city',
      }
    ],
    []
  );


  const Table = styled.table`
    width: 100px;
    height: 100px;
    display: table;
  `;


  const TableContainer = (columns) => {
    return(
<Table>
    <tbody>
        <tr>
            <td>Payment Id</td>
            <td>bla bla</td>
        </tr>
    </tbody>
</Table>
    );
  }; 

  export default TableContainer;
